import React from "react";
import PlayMovie from "../../movie/PlayMovie";
import  styled  from 'styled-components';
import Player from "../../movie/Player";
//
import { useState,useEffect } from "react";
import { YOUTUBEURL, PLAYLISTS, apiKey,PLAYLISTSITEMS } from "../../../API/apis";
// UCSB5FOwUVnAhGo_o99IhxYA


const HeaderMovie = () => {
  const channelId = "UCSB5FOwUVnAhGo_o99IhxYA"
  const Playlists = async () => {
    const [playlists, setPlaylists] = useState([]);

    const json = await (
      await fetch(
        `${YOUTUBEURL}${PLAYLISTS}?key=${apiKey}&channelId=${channelId}&maxResults=50&part=snippet`
      )
    ).json();
    setPlaylists(json);
    const id = playlists.items?.id;
    const title = playlists.items?.snippet.title;
    console.log("Playlist");
    console.log(id, title);
    return [id, title];
  };
  //
  const PlaylistItems = async () => {
    const [plistItems, setPlistItems] = useState([]);
    const id = Playlists(channelId)[0];
    const json = await (
      await fetch(
        `${YOUTUBEURL}${PLAYLISTSITEMS}?key=${apiKey}&playlistId=${id}&part=snippet`
      )
    ).json();
    setPlistItems(json);
    const videoId = plistItems.items?.snippet.resourceId.videoId;
    console.log("PlaylistItem");
    console.log(videoId);
    return videoId;
  };

  useEffect(() => {
    Playlists(channelId);
    PlaylistItems(channelId);
  },[])

  return (
    <div>
      <PlayMovie videoId={PlaylistItems("channelId")} />
      {/* <Player width="960px" height="400px"/> */}
    </div>
  );
};

export default HeaderMovie;
